INSERT INTO public.servants VALUES (289, 'Abigail Williams (Summer)', 'Foreigner', 'https://static.wikia.nocookie.net/fategrandorder/images/9/9c/S289A4Icon.webp', 'https://static.wikia.nocookie.net/fategrandorder/images/e/e5/Class-Foreigner-Gold.webp', 'servants/detail/Abigail Williams (Summer)_289.png', 'card_deck/QQABB.png', 'SSR', 'アビゲイル・ウィリアムズ〔夏〕', '1,820/11,781', '2,090/14,250', 'Ōwada Hitomi', 'Kuroboshi Kouhaku', 'Earth', 'Female', '150', '15%', '0.86%', '3%', '6%', 'Lawful.Evil', 289, 290, 291, '/servants/Abigail-Williams-(Summer)', 'Dreamlands;The Far Away Land of Dreams', 'Buster', 'A', 'Anti-Unit', '3', 'Removes all enemy''s defensive buffs. (Activates first)  Deals damage to them.', 'Reduces their defense for 3 turns.');
INSERT INTO public.servants VALUES (305, 'Amor (Caren)', 'Ruler', 'https://static.wikia.nocookie.net/fategrandorder/images/1/1c/S305A4Icon.webp', 'https://static.wikia.nocookie.net/fategrandorder/images/2/21/Class-Ruler-Gold.webp', 'servants/detail/Amor (Caren)_305.png', 'card_deck/QQAAB.png', 'SSR', 'アムール〔カレン〕; アムール ; カレン・C・オルテンシア ; ゴッドカレン ; デビルカレン ;', '1,754/11,351', '2,029/13,837', 'Koshimizu Ami', 'Morii Shizuki', 'Sky', 'Female', '101', '9.9%', '0.57%', '3%', '28.8%', 'Lawful.Good', 316, 317, 318, '/servants/Amor-(Caren)', 'The Greatest Hits - "Calling Agape";Universal Free Infinite Love', 'Quick', 'EX', 'Anti-Unit', '5', 'Deals damage to all enemies. Deals 150% extra damage to enemy with Chaotic Alignment . Reduces their Quick resistance by 20% for 3 turns. Inflicts Buff Block status for 1 time, 3 turns to them.', 'Increases own NP damage for 1 turn. (Activates first)');
INSERT INTO public.servants VALUES (307, 'Miss Crane', 'Caster', 'https://static.wikia.nocookie.net/fategrandorder/images/4/44/S307A4Icon.webp', 'https://static.wikia.nocookie.net/fategrandorder/images/2/2a/Class-Caster-Gold.webp', 'servants/detail/Miss Crane_307.png', 'card_deck/QAAAB.png', 'SSR', 'ミス・クレーン', '1,506/9,749', '2,195/14,971', 'Mizuhashi Kaori', 'Shaka P (LASENGLE)', 'Earth', 'Female', '49', '10.8%', '0.39%', '3%', '46.5%', 'Neutral.Good', 322, 323, 324, '/servants/Miss-Crane', 'Ten''i Muhou - Tsuru no Enishi Namida no Wakare;Perfect Beauty without Flaw -;The Crane''s Grateful Song of Parting;The Crane''s Fate, A Teary Farewell', 'Arts', 'EX', 'Anti-Unit', '0', '(Can only be used when there are 20 critical stars or more.) Increases first ally''s attack except self for 3 turns. Increases their NP damage by 30% for 3 turns. Moves self to last reserve slot. (Can only move if there are two other party members left in the field.) After moving, the Servant who comes out is the leftmost one in the sub slot. Unlike Order Change , the position change will reset the deck so it becomes the first turn of a new Command Cards cycle.', 'Charges first ally''s NP gauge except self.');
INSERT INTO public.servants VALUES (334, 'Koyanskaya of Darkness', 'Foreigner', 'https://static.wikia.nocookie.net/fategrandorder/images/9/9a/S334A4Icon.webp', 'https://static.wikia.nocookie.net/fategrandorder/images/e/e5/Class-Foreigner-Gold.webp', 'servants/detail/Koyanskaya of Darkness_334.png', 'card_deck/QAABB.png', 'SSR', '闇のコヤンスカヤ', '1,734 / 11,220', '2,156 / 14,700', 'Saito Chiwa', 'Wada Arco', 'Beast', 'Female', '153', '14.8%', '0.67%', '3%', '6%', 'Chaotic.Evil', 355, 356, 357, '/servants/Koyanskaya-of-Darkness', 'Tunguska Nine Drive;Thunderous Heavenly Light - The Calamitous Star Crashes Down in Waves of Flame', 'Buster', 'C', 'Anti-World', '5', 'Increases own attack by 20% for 1 turn. (Activates first) Deals damage to all enemies. Removes their offensive buffs.  Reduces their Buster resistance by 20% for 3 turns.', 'Deals extra damage to enemies with Earth Attribute .');
INSERT INTO public.servants VALUES (336, 'Manannán mac Lir (Bazett)', 'Alter Ego', 'https://static.wikia.nocookie.net/fategrandorder/images/4/48/S336A4Icon.webp', 'https://static.wikia.nocookie.net/fategrandorder/images/1/1b/Class-Alterego-Gold.webp', 'servants/detail/Manannán mac Lir (Bazett)_336.png', 'card_deck/QQABB.png', 'SSR', 'マナナン・マク・リール〔バゼット〕; バゼット・フラガ・マクレミッツ ; マナナン・マク・リール ;', '1,983 / 12,835', '1,881 / 12,825', 'Nabatame Hitomi', 'Hayashi Kewi', 'Sky', 'Female', '98', '10%', '0.8%', '4%', '25%', 'Neutral.Good', 358, 359, 360, '/servants/Manannán-mac-Lir-(Bazett)', 'Stage 1 ~ 2;Stage 3;Fragarach;Gouging Sword of the War God;Fragarach Enbarr;Wildly Running Sword of the War God', 'Quick', 'EX', 'Counter', '0', 'Draws attention of all enemies to self by 500% for 1 turn. Grants self Fragarach Counter Status for 1 turn. ( Fragarach Counter : 1 Hit (100%) Quick-Type Noble Phantasm Card Attack. (Ignores NP Seal, Buff Removal, Debuff Removal and Buff Block effects.) Deals damage to one enemy when taking attack or becoming target of active skills by them except some special actions. (If the enemy has Break Gauges, the counter attack cannot break it and 1 HP remains.) Reduces their Quick resistance by 10% for 3 turns. Gains 10 critical stars.) If a Buff Block skill is used by the enemy on Manannán mac Lir (Bazett), and if her Noble Phantasm is used after that then the Attack Up and Taunt effects on her NP will be blocked but the Fragarach Counter will be successfully cast. In succeeding action, if the enemy either uses an AoE Attack or an attack aimed at her, or uses an AoE Debuff or a Debuff aimed at her, she will be able to counter these actions. If a Buff Removal skill is used by the enemy on Manannán mac Lir (Bazett) after her Noble Phantasm is used, both the Attack Up and Taunt will successfully get removed but the Fragarach Counter will not get removed. This Buff Removal is treated as a normal action by the enemy so she will be able to counter it. In succeeding action, if the enemy either uses an AoE Attack or an attack aimed at her, or uses an AoE Debuff or a Debuff aimed at her, she will be able to counter these actions. If Manannán mac Lir (Bazett) is in a Immobility Debuff, Fragarach Counter will not be activated.  The counter is also not triggered when her HP is reduced to zero by an enemy attack. However, if she is revived by Guts, the counter will be activated. Also, if she is sacrificed to Chen Gong ''s NP while in a guts state, the counter will not trigger. Angra Mainyu ''s reflect damage also cannot trigger the counter. The Fragarach Counter can bypass an enemy having Taunt; the Fragarach Counter will always retaliate against the attacker regardless of whether another enemy has Taunt. The Fragarach Counter will be activated if NP Drain (debuff) is used by the enemy either on party or targeted on Manannán mac Lir (Bazett).', 'Increases own attack for 1 turn. (Activates first)');
INSERT INTO public.servants VALUES (351, 'Archetype: Earth', 'Moon Cancer', 'https://static.wikia.nocookie.net/fategrandorder/images/5/5d/S351A4Icon.webp', 'https://static.wikia.nocookie.net/fategrandorder/images/6/65/Class-MoonCancer-Gold.webp', 'servants/detail/Archetype Earth_351.png', 'card_deck/QAABB.png', 'SSR', 'アーキタイプ：アース ; アルクェイド・ブリュンスタッド', '1,792 / 11,601', '2,079 / 14,175', 'Hasegawa Ikumi', 'Takeuchi Takashi', 'Star', 'Female', '50', '15%', '0.45%', '3%', '0.6%', 'Chaotic.Good.Neutral.Good', 382, 383, 384, '/servants/Archetype:-Earth', 'Marble Phantasm;Fantasy Manifestation', 'Buster', 'EX', 'Anti-Army', '4', 'Changes field to Millennium Castle Battlefield for 3 turns. (Activates first) Deals damage to all enemies. Deals extra damage to enemies with Chaotic Alignment . When party moves to next stage, the field graphic will be reset. However, Millennium Castle Battlefield effect is still continued. ( icon at top right corner of the battle screen indicates this field buff is active. Tapping on it will also show the duration.) Millennium Castle Battlefield cannot be removed because it is attached to the field itself, not Servants. Millennium Castle Battlefield is stackable if you use the NP in successive or alternate turns. Millennium Castle Battlefield is removed if Archetype: Earth is defeated.', 'Charges the NP gauge of Living Human allies except self.');
